css:
@namespace url("http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul");
@-moz-document url("chrome://browser/content/aboutDialog.xul") {
  #aboutDialog[title*="Aurora"] #aboutDialogContainer {
    background: none !important;
    color: inherit !important;
  }
  #aboutDialog[title*="Aurora"] .text-link { color: -moz-nativehyperlinktext !important; }
  #aboutDialog[title*="Aurora"] #bottomBox .text-link {
    color: #fff !important;
    margin-top: 0 !important;
  }
  #leftBox {
    background-image: url("data:image/png;base64,") !important;
    background-position: 50% 0;
    background-repeat: no-repeat;
    min-width: 210px;
    min-height: 210px;
  }
  #rightBox {
    background-image: url("data:image/png;base64,") !important;
    background-size: auto 72px !important;
    margin-left: 30px !important;
  }
  #aboutDialog[title*="Aurora"] #rightBox { background-size: auto 56px !important; }
  #version { margin-top: 30px !important; }
  #aboutDialog[title*="Aurora"] #version {
    margin-top: 10px !important;
    margin-left: 100px !important;
  }
  #aboutDialog:not([title*="Aurora"]) #trademark { visibility: hidden; }
  #aboutDialog:not([title*="Aurora"]) #trademark:before {
    content: "Naruto is a teenage ninja from Konohagakure village. Don't mess with him.";
    visibility: visible;
    position: absolute;
  }
}
